      SELECT DISTINCT + 37 * + - col0 + + - 17 + - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 69 + - - col2 NOT IN ( - - col2 / + col2 + - 80 * col0 + - - col0 );
  - name: tab0

outputs:
  - name: q740.out
    data: |
      -3246
      -3705
      -619
